import React, { Component } from 'react';
import PhoneForm from './components/PhoneForm';

class App extends Component {
  _handleCreate = (data) => {
    console.log(data);
  }

  render() {
    return (
      <div>
        <PhoneForm onCreate={this._handleCreate}/>
      </div>
    )
  }
}


export default App;
